import React from "react";
import { Routes, Route } from "react-router-dom";
import LoginForm from "./LoginForm";
import DoctorList from "./DoctorList";

const App = () => {
  return (
    <Routes>
      <Route path="/" element={<LoginForm />} />
      <Route path="/doctor" element={<DoctorList />} />
    </Routes>
  );
};

export default App;
